INSERT INTO `product` (`id`, `brand_id`, `category_id`, `name`, `price`, `quantity`, `specs`, `description`, `image`, `sale_id`, `status`, `created_at`, `updated_at`) VALUES
(1, 2, 1, 'Samsung Galaxy S23 Ultra 5G 256GB', 26030000, 23, '<tr><td>Màn hình</td><td>6.8 inch, Dynamic AMOLED 2X, QHD+, 1440 x 3088 Pixels</td></tr><tr><td>Camera sau</td><td>200.0 MP + 12.0 MP + 10.0 MP + 10.0 MP </td></tr><tr><td>Camera Selfie</td><td>12.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>256 GB</td></tr><tr><td>CPU</td><td>Snapdragon 8 Gen 2</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>1 - 2 Nano SIM hoặc 1 eSIM, 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 13.0</td></tr><tr><td>Xuất xứ</td><td>Việt Nam / Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>02/2023</td></tr>', '<p>Tự hào là điện thoại Galaxy đầu tiên sở hữu cảm biến tuyệt đỉnh 200MP, Samsung Galaxy S23 Ultra đưa người dùng vào không gian nhiếp ảnh tân tiến vượt trội. Sức mạnh còn bùng nổ với vi xử lý Snapdragon mạnh nhất cho cách mạng hiệu năng gaming đột phá. Tất cả được gói gọn trong thiết kế cao cấp và bền vững cho hiện tại và tương lai.</p><p>Vẻ đẹp từ sắc màu thiên nhiên tinh tế</p><p>Tuyên ngôn sống xanh bền vững</p><p>Tương lai công nghệ hiển thị</p><p>Siêu bút S-Pen – ghi chú, phác thảo và hơn thế nữa</p><p>Trọn bộ 4 camera đột phá, dẫn đầu xu hướng nhiếp ảnh</p><p>Smartphone Galaxy đầu tiên có cảm biến siêu phân giải 200MP</p><p>Camera Mắt thần bóng đêm – đẳng cấp chụp đêm tốt nhất</p><p>Video đêm chuyên nghiệp - mượt mà trong từng thước phim</p><p>Tuyệt tác bầu trời đêm dễ dàng</p><p>Sáng tạo ảnh nghệ thuật trong tầm tay</p><p>Thế hệ chip mạnh nhất, mang tới những trận game bùng nổ</p><p>Viên pin bền bỉ cho cả ngày dài</p><p>Chuyển dữ liệu an toàn và nhanh chóng</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/2/638108933021851432_samsung-galaxy-s23-ultra-xanh-1.jpg\" alt=\"Samsung Galaxy S23 Ultra 5G 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/17/638122555347721262_samsung-galaxy-s23-ultra-xanh-2.jpg\" alt=\"Samsung Galaxy S23 Ultra 5G 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/17/638122555347096362_samsung-galaxy-s23-ultra-xanh-3.jpg\" alt=\"Samsung Galaxy S23 Ultra 5G 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/17/638122555348189869_samsung-galaxy-s23-ultra-xanh-4.jpg\" alt=\"Samsung Galaxy S23 Ultra 5G 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/17/638122555346625094_samsung-galaxy-s23-ultra-xanh-5.jpg\" alt=\"Samsung Galaxy S23 Ultra 5G 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/17/638122555345988762_samsung-galaxy-s23-ultra-xanh-6.jpg\" alt=\"Samsung Galaxy S23 Ultra 5G 256GB\">', 2, '1', '2023-05-14 11:35:20', '2023-05-14 11:35:20'),
(2, 4, 1, 'Xiaomi Redmi 10A 3GB-64GB', 2590000, 27, '<tr><td>Màn hình</td><td>6.53 inch, IPS LCD, HD+, 720 x 1600 Pixels</td></tr><tr><td>Camera sau</td><td>13.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>5.0 MP </td></tr><tr><td>RAM</td><td>3 GB</td></tr><tr><td>Bộ nhớ trong</td><td>64 GB</td></tr><tr><td>CPU</td><td>Helio G25</td></tr><tr><td>GPU</td><td>PowerVR GE8320</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 11</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>07/2022</td></tr>', '<p>Redmi 10A là sản phẩm giá rẻ tiếp theo Xiaomi đem đến cho người dùng. Ở phân khúc giá, chiếc điện thoại này sở hữu một màn hình lớn, camera kép, dung lượng pin khủng và một thiết kế độc đáo. Đây sẽ là lựa chọn không thể tốt hơn dành cho người dùng phổ thông. </p><p>Trải nghiệm hình ảnh sống động trên màn hình lớn</p><p>Thỏa thích sử dụng, không lo hết pin </p><p>Thiết kế mới lạ, cao cấp </p><p>Lưu giữ mọi khoảnh khắc với camera kép chất lượng</p><p>Trải nghiệm hiệu năng ổn định </p><p>Hệ thống âm thanh ngoài mong đợi</p><p>Thoải mái lưu trữ những gì bạn muốn</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/21/638072287029793818_Xiaomi-Redmi-10A-2GB-32GB-xam-1.jpg\" alt=\"Xiaomi Redmi 10A 3GB-64GB\">', 3, '1', '2023-05-14 11:35:20', '2023-05-14 11:35:20'),
(3, 1, 1, 'iPhone 11 64GB', 10280000, 22, '<tr><td>Màn hình</td><td>6.1 inch, IPS LCD, Liquid Retina HD, 828 x 1792 Pixels</td></tr><tr><td>Camera sau</td><td>12.0 MP + 12.0 MP </td></tr><tr><td>Camera Selfie</td><td>12.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>64 GB</td></tr><tr><td>CPU</td><td>Apple A13 Bionic</td></tr><tr><td>GPU</td><td>Apple GPU 4 nhân</td></tr><tr><td>Dung lượng pin</td><td>3110 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 1 eSIM, 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>iOS 14</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>09/2019</td></tr>', '<p>iPhone 11 với 6 phiên bản màu sắc, camera có khả năng chụp ảnh vượt trội, thời lượng pin cực dài và bộ vi xử lý mạnh nhất từ trước đến nay sẽ mang đến trải nghiệm tuyệt vời dành cho bạn.</p><p>Rực rỡ sắc màu, thể hiện cá tính với iPhone 11</p><p>Hệ thống camera kép mới</p><p>Quay video chưa bao giờ chuyên nghiệp đến thế</p><p>Night Mode, chuyên gia chụp ảnh thiếu sáng</p><p>Hiệu ứng xóa phông “ảo diệu”</p><p>Smart HDR thế hệ mới, chụp ảnh tốt hơn trong điều kiện ánh sáng phức tạp</p><p>Camera trước 12MP, hơn cả chụp ảnh selfie</p><p>Chiếc iPhone bền bỉ và thân thiện</p><p>Màn hình Liquid Retina sống động đến từng chi tiết</p><p>Thoải mái sử dụng cả ngày</p><p>Sức mạnh đẳng cấp khác biệt</p><p>Nhận diện khuôn mặt nhanh hơn bao giờ hết</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059306728859551_iphone-11-den-1.jpg\" alt=\"iPhone 11 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059306729015793_iphone-11-den-2.jpg\" alt=\"iPhone 11 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059306729015793_iphone-11-den-3.jpg\" alt=\"iPhone 11 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059306728547044_iphone-11-den-4.jpg\" alt=\"iPhone 11 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059306728859551_iphone-11-den-5.jpg\" alt=\"iPhone 11 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059306729960073_iphone-11-den-6.jpg\" alt=\"iPhone 11 64GB\">', 3, '1', '2023-05-14 11:35:20', '2023-05-14 11:35:20'),
(4, 3, 1, 'OPPO A77s 8GB-128GB', 6290000, 28, '<tr><td>Màn hình</td><td>6.56 inch, LCD, HD+, 720 x 1612 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>8.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Snapdragon 680</td></tr><tr><td>GPU</td><td>Adreno 610</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12 (ColorOS 12.1)</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>10/2022</td></tr>', '<p>Cuộc sống trở nên thú vị hơn khi có người bạn đồng hành trẻ trung, năng động – OPPO A77s. Chiếc điện thoại tầm trung với thiết kế hiện đại, tươi trẻ đi cùng những công nghệ ấn tượng như camera kép AI 50MP, sạc nhanh 33W, Snapdragon 680 và hỗ trợ mở rộng RAM.</p><p>Mỏng nhẹ và sắc màu thời trang</p><p>Sẵn sàng cho cuộc chơi hiệu năng</p><p>Đồng hành cả ngày dài</p><p>Sạc nhanh siêu tốc cho cuộc sống năng động</p><p>Camera kép AI 50MP thông minh</p><p>Ảnh siêu nét 108MP</p><p>Ảnh selfie HDR rạng ngời</p><p>Giải trí trên màn hình 90Hz mượt mà</p><p>Hệ thống loa nổi sống động</p><p>Trải nghiệm vô tư bất kỳ đâu</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/5/638005897366049263_oppo-a77s-den-5.jpg\" alt=\"OPPO A77s 8GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/5/638005897365111890_oppo-a77s-den-4.jpg\" alt=\"OPPO A77s 8GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/5/638005672570755785_oppo-a77s-den-3.jpg\" alt=\"OPPO A77s 8GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/5/638005897365893263_oppo-a77s-den-2.jpg\" alt=\"OPPO A77s 8GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/5/638005672570287108_oppo-a77s-den-1.jpg\" alt=\"OPPO A77s 8GB-128GB\">', 1, '1', '2023-05-14 11:35:20', '2023-05-14 11:35:20'),
(5, 4, 1, 'Xiaomi Redmi Note 11 Pro 8GB - 128GB', 5990000, 17, '<tr><td>Màn hình</td><td>6.67 inch, AMOLED, FHD+, 1080 x 2400 Pixels</td></tr><tr><td>Camera sau</td><td>108.0 MP + 8.0 MP + 2.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>16.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>CPU</td><td>MediaTek Helio G96</td></tr><tr><td>GPU</td><td>Mali-G57 MC2</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 11</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>02/2022</td></tr>', '<p>Xiaomi Redmi Note 11 Pro là một trong những chiếc điện thoại mới nhất thuộc Redmi Note 11 series ra mắt gần đây. Điện thoại được trang bị những thông số ấn tượng nhưng vẫn được bán ra ở phân khúc tầm trung. Với những camera chất lượng lên đến 108MP, màn hình 120Hz và sạc nhanh 67W, đây là chiếc điện thoại hoàn hảo cho bạn khi cần. </p><p>Chi tiết bức ảnh đặt lên hàng đầu</p><p>Chụp đêm trở nên dễ dàng và tuyệt đẹp</p><p>Trải nghiệm màn hình ở tầm cao mới</p><p>Không ngại thiếu hụt năng lượng</p><p>Trải nghiệm chơi game, giải trí mượt mà</p><p>Thiết kế thời trang, tạo xu hướng mới</p><p>Âm thanh nổi sống động</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/2/14/637804673212874594_2.xiaomi-redmi-note-11-pro-4g-trang-4.jpg\" alt=\"Xiaomi Redmi Note 11 Pro 8GB - 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/2/14/637804673213499589_2.xiaomi-redmi-note-11-pro-4g-trang-3.jpg\" alt=\"Xiaomi Redmi Note 11 Pro 8GB - 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/2/14/637804673213499589_2.xiaomi-redmi-note-11-pro-4g-trang-2.jpg\" alt=\"Xiaomi Redmi Note 11 Pro 8GB - 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/2/14/637804673223655752_2.xiaomi-redmi-note-11-pro-4g-trang-1.jpg\" alt=\"Xiaomi Redmi Note 11 Pro 8GB - 128GB\">', 1, '1', '2023-05-14 11:35:20', '2023-05-14 11:35:20'),
(6, 2, 1, 'Samsung Galaxy S22 5G 128GB', 12780000, 16, '<tr><td>Màn hình</td><td>6.1 inch, Dynamic AMOLED 2X, FHD+, 1080 x 2340 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 12.0 MP + 10.0 MP </td></tr><tr><td>Camera Selfie</td><td>10.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Snapdragon 8 Gen 1</td></tr><tr><td>GPU</td><td>Adreno 730</td></tr><tr><td>Dung lượng pin</td><td>3700 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM hoặc 1 eSIM, 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam / Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>07/2022</td></tr>', '<p>Samsung Galaxy S22 là bước nhảy vọt trong công nghệ video trên thế hệ di động. Đồng thời, điện thoại cũng mở ra loạt cải tiến đột phá hàng đầu hiện nay từ màn hình vát phẳng “nịnh” mắt đến bộ xử lý 4nm tiên tiến đầu tiên trên thế hệ smartphone Samsung.</p><p>Kiệt tác của tinh thần sáng tạo</p><p>Sắc màu thời thượng, dẫn đầu xu thế</p><p>Trở thành nhiếp ảnh gia chuyên nghiệp trong lòng bàn tay</p><p>Thắp sáng màn đêm với Nightography</p><p>Các thước phim đêm trở nên diệu kỳ hơn</p><p>Mỗi video đều thật sự ưng ý</p><p>Mãn nhãn trong từng chi tiết</p><p>Hiệu năng nhanh nhất trên smartphone Galaxy</p><p>Sạc nhanh sẵn sàng mọi tác vụ</p><p>Chuyển dữ liệu từ smartphone cũ sang Galaxy S22 đơn giản</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/7/23/637941779749495327_samsung-galaxy-s22-bora-purple-1.jpg\" alt=\"Samsung Galaxy S22 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/7/23/637941779748870189_samsung-galaxy-s22-bora-purple-2.jpg\" alt=\"Samsung Galaxy S22 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/7/23/637941779746995258_samsung-galaxy-s22-bora-purple-3.jpg\" alt=\"Samsung Galaxy S22 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/7/23/637941779749182644_samsung-galaxy-s22-bora-purple-4.jpg\" alt=\"Samsung Galaxy S22 5G 128GB\">', 3, '1', '2023-05-14 11:35:20', '2023-05-14 11:35:20'),
(7, 3, 1, 'OPPO Reno8 T 5G 128GB', 9990000, 19, '<tr><td>Màn hình</td><td>6.7 inch, AMOLED, FHD+, 1080 x 2412 Pixels</td></tr><tr><td>Camera sau</td><td>108.0 MP + 2.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>32.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Snapdragon 695 5G</td></tr><tr><td>GPU</td><td>Adreno 619</td></tr><tr><td>Dung lượng pin</td><td>4800 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 13.0 (ColorOS 13)</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>02/2023</td></tr>', '<p>Trọn vẹn từng trải nghiệm trên OPPO Reno8 T 5G với nâng cấp toàn diện từ thế hệ chân dung 108MP, màn hình cong 120Hz tuyệt đẹp đến sạc nhanh Super VOOCTM 67W. Bạn sẽ bất ngờ với những gì OPPO Reno8 T 5G mang đến – một siêu phẩm trong tầm giá.</p><p>Màn hình cong 120Hz – Mãn nhãn chuẩn flagship</p><p>Đắm chìm trong 1 tỷ sắc màu</p><p>Nét đẹp rực rỡ từ công nghệ Glow</p><p>Chi tiết trong từng điểm ảnh</p><p>Camera 108MP đầu tiên của dòng Reno</p><p>Chuyên gia chân dung dễ dàng</p><p>Bắt trọn từng khoảnh khắc</p><p>Khám phá những chi tiết siêu nhỏ – kính hiển vi 40x</p><p>Sạc nhanh vượt trội 67W – nhanh đáng kinh ngạc</p><p>Đa nhiệm nhiều hơn với mở rộng RAM</p><p>Hiệu năng từ chip “rồng” Snapdragon 695</p><p>Chứng nhận độ mượt trong 48 tháng</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/2/638109492842561801_oppo-reno8-t-5g-vang-5.jpg\" alt=\"OPPO Reno8 T 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/2/638109492829105392_oppo-reno8-t-5g-vang-3.jpg\" alt=\"OPPO Reno8 T 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/1/30/638106988530845194_oppo-r