(8, 1, 1, 'iPhone 12 64GB', 14899000, 10, '<tr><td>Màn hình</td><td>6.1 inch, OLED, Super Retina XDR, 2532 x 1170 Pixels</td></tr><tr><td>Camera sau</td><td>12.0 MP + 12.0 MP </td></tr><tr><td>Camera Selfie</td><td>12.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>64 GB</td></tr><tr><td>CPU</td><td>Apple A14 Bionic</td></tr><tr><td>Dung lượng pin</td><td>2815 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 1 eSIM, 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>iOS 14</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>10/2020</td></tr>', '<p>iPhone 12 ra mắt với vai trò mở ra một kỷ nguyên hoàn toàn mới. Tốc độ mạng 5G siêu tốc, bộ vi xử lý A14 Bionic nhanh nhất thế giới smartphone, màn hình OLED tràn cạnh tuyệt đẹp và camera siêu chụp đêm, tất cả đều có mặt trên điện thoại iPhone 12.</p><p>Thiết kế mỏng nhẹ, nhỏ gọn và đẳng cấp</p><p>Ceramic Shield, bảo vệ an toàn cho mặt kính</p><p>iPhone 12 chống nước hoàn hảo</p><p>Màu sắc mới của iPhone 12</p><p>5G siêu tốc, mở ra kỷ nguyên di động mới</p><p>Apple A14 Bionic, bộ vi xử lý nhanh nhất thế giới smartphone</p><p>Màn hình OLED Super Retina XDR siêu sắc nét</p><p>Hệ thống camera mới, thách thức màn đêm</p><p>Smart HDR 3, chụp đẹp trong mọi hoàn cảnh</p><p>Một phim trường ngay trên tay bạn</p><p>Selfie trong đêm tuyệt đẹp với iPhone 12</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059237853240136_iphone-12-xanhla-1.jpg\" alt=\"iPhone 12 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059237853083337_iphone-12-xanhla-2.jpg\" alt=\"iPhone 12 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/12/6/638059237852757989_iphone-12-xanhla-3.jpg\" alt=\"iPhone 12 64GB\"><img src=\"https://images.fpt.