(9, 2, 1, 'Samsung Galaxy A34 5G', 7370000, 22, '<tr><td>Màn hình</td><td>Chính: 6.6 inch, Super AMOLED, FHD+, 1080 x 2400 Pixels</td></tr><tr><td>Camera sau</td><td>48.0 MP + 8.0 MP + 5.0 MP </td></tr><tr><td>Camera Selfie</td><td>13.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>MediaTek Dimensity 1080</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc / Việt Nam </td></tr><tr><td>Thời gian ra mắt</td><td>3/2023</td></tr>', '<p>Sở hữu những tính năng hàng đầu trong phân khúc, đi kèm mức giá hợp lý, Samsung Galaxy A34 là “chiến hữu” kề vai sát cánh cùng Gen Z, sẵn sàng cân mọi hoạt động, chinh phục mọi thử thách. Hãy trải nghiệm Galaxy A34 5G, bạn sẽ thấy sự khác biệt từ thiết kế hiện đại, màn hình 120Hz, bộ 3 camera 48MP sắc nét đến hiệu năng Dimensity 1080 mạnh mẽ.</p><p>Độ sáng hoàn hảo, sống động mọi nơi</p><p>Thiết kế trẻ trung, đậm chất dòng Galaxy A</p><p>Mọi khung hình đều sáng giá</p><p>Chụp đêm dẫn đầu phân khúc</p><p>Ảnh thêm đẹp nhờ trình sửa ảnh thông minh</p><p>Hiệu năng thần tốc, xử lý mượt mọi tác vụ</p><p>Pin lớn 5.000mAh, đáp ứng đến hơn 2 ngày dùng</p><p>Tích hợp chuẩn kháng nước IP67, sẵn sàng cho mọi hoạt động</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144925777172420_samsung-galaxy-a34-bac-2.jpg\" alt=\"Samsung Galaxy A34 5G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144925776737043_samsung-galaxy-a34-bac-3.jpg\" alt=\"Samsung Galaxy A34 5G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144925776138301_samsung-galaxy-a34-bac-4.jpg\" alt=\"Samsung Galaxy A34 5G\">