(10, 2, 1, 'Samsung Galaxy A54 5G 128GB', 8970000, 16, '<tr><td>Màn hình</td><td>Chính: 6.4 inch, Super AMOLED, FHD+, 1080 x 2400 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 12.0 MP + 5.0 MP </td></tr><tr><td>Camera Selfie</td><td>32.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Exynos 1380</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam / Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>3/2023</td></tr>', '<p>Tỏa sáng với thế hệ Galaxy A mới trẻ trung và năng động, Samsung Galaxy A54 sát cánh cùng người dùng trong mọi trải nghiệm di động đỉnh cao từ thiết kế đột phá, sức mạnh Exynos 1380, đến tận dụng tối đa công nghệ nhiếp ảnh tiên tiến, tiên phong chống rung OIS, mang tới hệ thống camera đẳng cấp, thước phim chuẩn nét dù ngày hay đêm.</p><p>Diện mạo đột phá và thời thượng</p><p>Sắc nét mọi khung hình</p><p>Thước phim chuẩn nét trong tầm tay</p><p>Nightography – “chiến thần” chụp đêm đỉnh cao</p><p>Trình chỉnh sửa ảnh chuyên nghiệp</p><p>Những công nghệ màn hình vượt trội</p><p>Tốc độ tiên phong, tuyệt đỉnh để sẵn sàng “chiến” mọi game</p><p>Trải nghiệm hơn 2 ngày</p><p>Kháng nước IP67 bền bỉ</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144940397499004_samsung-galaxy-a54-5g-den-1.jpg\" alt=\"Samsung Galaxy A54 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144940397656271_samsung-galaxy-a54-5g-den-2.jpg\" alt=\"Samsung Galaxy A54 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144940396733063_samsung-galaxy-a54-5g-den-3.jpg\" alt=\"Samsung Galaxy A54 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144940397812602_samsung-galaxy-a54-5g-den-4.jpg\" alt=\"Samsung Galaxy A54 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/15/638144940395951814_samsung-galaxy-a54-5g-den-5.jpg\" alt=\"Samsung Galaxy A54 5G 128GB\">', 1, '1', '2023-05-14 11:35:20', '2023-05-14 11:35:20'),
(11, 6, 1, 'realme C55 6GB-128GB', 4090000, 15, '<tr><td>Màn hình</td><td>6.7 inch, LCD, FHD+, 1080 x 2400 Pixels</td></tr><tr><td>Camera sau</td><td>64.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>8.0 MP </td></tr><tr><td>RAM</td><td>6 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>MediaTek Helio G88</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 13.0</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>03/2023</td></tr>', '<p>Mở màn cho những trải nghiệm mới trên điện thoại Realme trong năm 2023, tân binh Realme C55 chinh phục người dùng bởi camera kép 64MP, màn hình lớn giải trí sắc nét, sạc nhanh 33W cùng ngôn ngữ thiết kế trẻ trung, hiện đại và ấn tượng ngay lần đầu gặp gỡ.</p><p>Nổi bật, mỏng nhẹ và thời thượng</p><p>Nhiếp ảnh chất lượng, mở khóa trải nghiệm</p><p>Khuấy động màn đêm với Night Mode</p><p>Tuyệt tác ảnh chân dung</p><p>Bộ nhớ lớn – lưu trữ “tẹt ga”</p><p>Tận hưởng sức mạnh Helio G88, có hỗ trợ mở rộng RAM</p><p>Ấn tượng bởi màn hình mượt mà 90Hz</p><p>Dung lượng pin lớn, sạc nhanh tuyệt hảo</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/21/638150124687384654_realme-c55-vang-5.jpg\" alt=\"realme C55 6GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/21/638150124686468546_realme-c55-vang-2.jpg\" alt=\"realme C55 6GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/11/638141305319388581_realme-c55-vang-3.jpg\" alt=\"realme C55 6GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/21/638150124842970902_realme-c55-vang-4.jpg\" alt=\"real