(12, 4, 1, 'Xiaomi 13 Lite 8GB-128GB', 8990000, 23, '<tr><td>Màn hình</td><td>6.55 inch, AMOLED, FHD+, 1080 x 2400 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 8.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>32.0 MP + 8.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Snapdragon 7 Gen 1</td></tr><tr><td>GPU</td><td>Qualcomm Adreno</td></tr><tr><td>Dung lượng pin</td><td>4500 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>2023</td></tr>', '<p>Sở hữu một con chip mới mạnh mẽ, hệ thống camera kép ở mặt trước, màn hình sống động hay đơn giản hơn là thiết kế mỏng nhẹ ấn tượng, Xiaomi 13 Lite nhanh chóng chiếm trọn lòng tin người dùng. Với mức giá cực hấp dẫn khi đến tay người dùng, Xiaomi 13 Lite đáng đến từng xu bỏ ra và hứa hẹn sẽ mang về thành công cho thương hiệu đến từ quốc gia tỷ dân. </p><p>Sức mạnh đến từ Snapdragon 7 Gen 1</p><p>Mang đến thiết kế cong nhẹ, siêu mỏng</p><p>3 phiên bản màu cá tính, mạnh mẽ</p><p>Kiệt tác đến từ camera selfie kép</p><p>Thích ứng với việc selfie thiếu ánh sáng</p><p>Chế độ Thu phóng Selfie đầy tinh tế</p><p>Nâng cấp toàn diện cho chế độ Vlog</p><p>Ghi lại mọi khoảnh khắc với cụm camera sau</p><p>Trải nghiệm nghe nhìn trên cả tuyệt vời</p><p>Mỏng nhẹ nhưng thời lượng pin dài</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/20/638125128408536178_xiaomi-13-lite-den-1.jpg\" alt=\"Xiaomi 13 Lite 8GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/2/20/638125128406872246_xiaomi-13-lite-den-2.jpg\" alt=\"Xiaomi 13 Lite 8GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals