(13, 2, 1, 'Samsung Galaxy A14 4G', 3650000, 27, '<tr><td>Màn hình</td><td>6.6 inch, PLS LCD, FHD+, 1080 x 2408 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 2.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>13.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Exynos 850</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam / Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>03/2023</td></tr>', '<p>Thêm sắc màu và trải nghiệm cho cuộc sống của bạn, Samsung giới thiệu Galaxy A14 4G giá rẻ với loạt điểm cải tiến mới. Mọi thứ được kết hợp hài hòa từ thiết kế trẻ trung, hệ thống camera 50MP, màn hình sắc nét cho đến viên pin siêu lớn, tạo ra chiếc điện thoại hấp dẫn với nhiều ưu điểm tuyệt vời dành cho giới trẻ.</p><p>Khám phá màn hình sống động và chân thực</p><p>Kiểu dáng hiện đại, sắc màu trẻ trung</p><p>Ảnh sắc nét với bộ 4 camera 50MP</p><p>Dễ dàng ghi lại mọi khung hình</p><p>Mạnh mẽ với chip lõi tám</p><p>Công nghệ mở rộng RAM Plus ấn tượng</p><p>Thời lượng pin bền bỉ</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/3/638134395342959448_samsung-galaxy-a14-4g-den-2.jpg\" alt=\"Samsung Galaxy A14 4G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/3/638134395341470562_samsung-galaxy-a14-4g-den-5.jpg\" alt=\"Samsung Galaxy A14 4G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/3/638134395342919275_samsung-galaxy-a14-4g-den-4.jpg\" alt=\"Samsung Galaxy A14 4G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/3/638134395342789279