(14, 3, 1, 'OPPO Reno8 4G 8GB - 256GB', 7490000, 15, '<tr><td>Màn hình</td><td>Chính: 6.4 inch, Chính: AMOLED, FHD+, 1080 x 2400 Pixels</td></tr><tr><td>Camera sau</td><td>64.0 MP + 2.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>32.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>256 GB</td></tr><tr><td>CPU</td><td>Snapdragon 680</td></tr><tr><td>GPU</td><td>Adreno 610</td></tr><tr><td>Dung lượng pin</td><td>4500 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12 (ColorOS 12.1)</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>04/2022</td></tr>', '<p>Với OPPO Reno8, trải nghiệm nhiếp ảnh trên smartphone đã đột phá ranh giới cũ. Sự kết hợp giữa cảm biến camera siêu nhạy IMX709 với ống kính Micro30x giúp chiếc Reno8 mới nhất hóa thân thành một công cụ chụp ảnh chuyên nghiệp, một chuyên gia chụp chân dung hàng đầu.</p><p>Chiếc điện thoại với hệ thống camera hoàn hảo</p><p>Selfie sống động, tự nhiên trong nhiều bối cảnh</p><p>Để mỗi bức ảnh chân dung đều sống động</p><p>Ngỡ ngàng trước sự sắc nét của hình ảnh</p><p>Chụp sắc nét cả trong bối cảnh thiếu sáng</p><p>Selfie ngược sáng chẳng phải vấn đề</p><p>Bokeh Flare, xóa phông chuẩn chuyên nghiệp</p><p>Tối ưu vẻ đẹp tự nhiên cho bạn</p><p>Lưu giữ vẻ đẹp từ những điều nhỏ bé nhất</p><p>Mỏng gọn, hiện đại mà vẫn thân thiện</p><p>Mặt lưng long lanh, đèn viền quỹ đạo</p><p>Bảo chứng sức mạnh bởi Qualcomm Snapdragon</p><p>Pin 4.500 mAh, sạc SuperVOOC</p><p>Màn hình AMOLED 90Hz mãn nhãn, mượt mà</p><p>Độ bền chuẩn mực, chống nước IPX4</p><p>ColorOS bảo mật, thân thiện và đẹp mắt</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/8/5/637952897276364359_oppo-reno8-4g-den-5.jpg\" alt=\"OPPO Reno8 4G 8GB - 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/O