(15, 3, 1, 'OPPO A17k 3GB-64GB', 2990000, 12, '<tr><td>Màn hình</td><td>6.56 inch, LCD, HD+, 720 x 1612 Pixels</td></tr><tr><td>Camera sau</td><td>8.0 MP </td></tr><tr><td>Camera Selfie</td><td>5.0 MP </td></tr><tr><td>RAM</td><td>3 GB</td></tr><tr><td>Bộ nhớ trong</td><td>64 GB</td></tr><tr><td>CPU</td><td>Helio G35</td></tr><tr><td>GPU</td><td>PowerVR GE8320</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12 (ColorOS 12.1)</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>10/2022</td></tr>', '<p>Nổi bật bởi thiết kế hiện đại, tràn đầy năng lượng, OPPO A17k ghi điểm với bạn ngay lần đầu nhìn thấy. Đồng thời, smartphone còn ẩn chứa vô vàn trải nghiệm ấn tượng trong tầm giá với viên pin lớn, RAM mở rộng đa nhiệm mượt mà, cảm biến vân tay cạnh bên hiện đại và chống nước IPX4 bền bỉ.</p><p>Dáng vẻ hiện đại và sang trọng</p><p>Giải trí không giới hạn, bền bỉ cả ngày dài</p><p>Chip 8 nhân ổn định, bộ nhớ lớn lưu trữ thoải mái</p><p>Màn hình đa sắc màu</p><p>Cảm biến vân tay cạnh bên thuận tiện</p><p>Camera AI chụp ảnh sắc nét và xóa phông ấn tượng</p><p>Ảnh selfie xuất sắc</p><p>Chống nước IPX4, bảo vệ máy tối ưu</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/11/2/638029862729276175_oppo-a17k-xanh-4.jpg\" alt=\"OPPO A17k 3GB-64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/11/2/638029862728227665_oppo-a17k-xanh-5.jpg\" alt=\"OPPO A17k 3GB-64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/26/638023775851267307_oppo-a17k-xanh-1.jpg\" alt=\"OPPO A17k 3GB-64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/11/