(16, 2, 1, 'Samsung Galaxy A04', 2440000, 25, '<tr><td>Màn hình</td><td>6.5 inch, HD+, 720 x 1600 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 2.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>5.0 MP </td></tr><tr><td>RAM</td><td>3 GB</td></tr><tr><td>Bộ nhớ trong</td><td>32 GB</td></tr><tr><td>CPU</td><td>Helio P35</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam / Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>2022</td></tr>', '<p>Gặp gỡ Samsung Galaxy A04 với những trải nghiệm bất ngờ. Bạn sẽ tận hưởng chiếc smartphone giá rẻ sở hữu hệ thống camera kép 50MP siêu sắc nét, pin khủng 5.000mAh giải trí “tẹt ga” và sự có mặt của RAM Plus, sẵn sàng mở rộng RAM bất cứ khi nào.</p><p>Màn hình lớn, trải nghiệm thoải mái</p><p>Thiết kế hiện đại, tinh xảo</p><p>Camera 50MP chinh phục mọi khoảnh khắc</p><p>Ảnh chân dung nghệ thuật</p><p>Selfie lung linh trong mỗi khung hình</p><p>Gặp gỡ viên pin khủng, dùng đến 2 ngày</p><p>Mở rộng RAM ngay lập tức với RAM Plus</p><p>Tốc độ tối ưu, lưu trữ tối đa</p><p>Tận hưởng âm thanh Dolby Atmos</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/11/638011085204016717_samsung-galaxy-a04-den-3.jpg\" alt=\"Samsung Galaxy A04\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/11/638011085203860493_samsung-galaxy-a04-den-2.jpg\" alt=\"Samsung Galaxy A04\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/11/638011085202339359_samsung-galaxy-a04-den-5.jpg\" alt=\"Samsung Galaxy A04\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/10/11/638011085203703638_samsung-ga