(17, 3, 1, 'Oppo Reno6 5G', 7290000, 29, '<tr><td>Màn hình</td><td>6.43 inch, AMOLED, FHD+, 1080 x 2400 Pixels</td></tr><tr><td>Camera sau</td><td>64.0 MP + 8.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>32.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>MediaTek Dimensity 900 5G</td></tr><tr><td>GPU</td><td>Mali-G68 MC4</td></tr><tr><td>Dung lượng pin</td><td>4300 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 11</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>07/2021</td></tr>', '<p>Sẵn sàng bật tung cảm xúc cùng OPPO Reno6 5G, chiếc điện thoại sở hữu thiết kế đẳng cấp siêu mỏng nhẹ, camera chụp chân dung Bokeh Flare độc đáo và trên hết là kết nối mạng 5G siêu tốc, cùng bạn kết nối tương lai.</p><p>Quay video xóa phông cực đỉnh</p><p>Thế giới màu sắc sống động</p><p>Thiết kế siêu mỏng nhẹ, đơn giản nhưng đậm chất tinh tế</p><p>Đến với kỷ nguyên của tốc độ</p><p>Thoải mái đa nhiệm và lưu trữ</p><p>Công nghệ sạc siêu nhanh 65W</p><p>Chơi game chuyên nghiệp</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2021/7/21/637624918161746288_oppo-reno6-den-1.jpg\" alt=\"Oppo Reno6 5G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2021/7/21/637624918162839828_oppo-reno6-den-2.jpg\" alt=\"Oppo Reno6 5G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2021/7/21/637624918157683423_oppo-reno6-den-3.jpg\" alt=\"Oppo Reno6 5G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2021/7/21/637624918163621115_oppo-reno6-den-4.jpg\" alt=\"Oppo Reno6 5G\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2021/7/21/637624918153620815_oppo-reno6-den-5.jpg\" alt=\"Oppo Reno6 5G\">', 2, '1', '2023-05-14 11:36:52', '2023-05-14 11:36:52'),
(18, 3, 1, 'OPPO A57 4GB-128GB', 4190000, 24, '<tr><td>Màn hình</td><td>6.56 inch, LCD, HD+, 720 x 1612 Pixels</td></tr><tr><td>Camera sau</td><td>13.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>8.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Helio G35</td></tr><tr><td>GPU</td><td>PowerVR GE8320</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12 (ColorOS 12.1)</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>6/2022</td></tr>', '<p>Chào đón thế hệ OPPO A mới với diện mạo trẻ trung, năng động – OPPO A57 sẽ đồng hành cùng bạn trong xu hướng thiết kế thời thượng năm 2022. Điện thoại còn tiện lợi với viên pin lớn 5.000mAh và công nghệ sạc nhanh 33W vượt trội trong phân khúc, giúp bạn luôn có kết nối liền mạch.</p><p>Năng lượng cả ngày dài</p><p>Cảm nhận sự khác biệt trong thiết kế</p><p>Màn hình đầy màu sắc sống động</p><p>Âm thanh chất lượng</p><p>Trải nghiệm hiệu năng mượt mà</p><p>Bền bỉ theo năm tháng</p><p>Điện thoại OPPO A57</p><p>Ảnh chân dung rạng ngời</p><p>Ảnh selfie tự nhiên</p><p>Trải nghiệm ColorOS 12.1 thú vị</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/6/27/637919437068621162_oppo-a57-den-3.jpg\" alt=\"OPPO A57 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/27/637998708770319266_oppo-a57-den-4.jpg\" alt=\"OPPO A57 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/6/17/637910569084038088_oppo-a57-den-5.jpg\" alt=\"OPPO A57 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/27/637998708771256795_oppo-a57-den-2.jpg\" alt=\"OPPO A57 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/6/17/637910569083881950_oppo-a57-den-1.jpg\" alt=\"OPPO A57 4GB-128GB\">', 2, '1', '2023-05-14 11:36:52', '2023-05-14 11:36:52'),
(19, 4, 1, 'Xiaomi Redmi 12C 4GB - 64GB', 2840000, 26, '<tr><td>Màn hình</td><td>6.71 inch, IPS LCD, HD+, 720 x 1650 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 0.08 MP </td></tr><tr><td>Camera Selfie</td><td>5.0 MP + 5.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>64 GB</td></tr><tr><td>CPU</td><td>Helio G85</td></tr><tr><td>GPU</td><td>Mali-G52 MC2</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12 (MIUI 13)</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>01/01/2023</td></tr>', '<p>Là sản phẩm giá rẻ nhưng Redmi 12C lại sở hữu nhiều công nghệ mới và mạnh mẽ, giúp cho người dùng phổ thông dễ dàng hơn trong việc tiếp cận với thế giới công nghệ hiện nay. Với hiệu suất cao, thời lượng pin cao, cụm camera sắc nét cùng giá bán vô cùng hấp dẫn, Redmi 12C dự kiến sẽ khuấy đảo thị trường phân khúc trên dưới 3 triệu đồng. </p><p>Cụm camera kép siêu nét</p><p>Hỗ trợ chụp đêm và HDR</p><p>Nâng cấp lớn về thuật toán chụp ảnh</p><p>Trải nghiệm mượt mà với bộ xử lý 8 nhân</p><p>Màn hình lớn với chất lượng hiển thị sống động</p><p>Năng lượng tràn đầy, đồng hành mọi nơi</p><p>Hệ thống loa với âm thanh cực lớn</p><p>Giao diện MIUI 13 mượt mà</p><p>Thiết kế cá tính với nhiều tùy chọn màu</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/8/638138646675311035_xiaomi-redmi-12c-xam-1.jpg\" alt=\"Xiaomi Redmi 12C 4GB - 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/8/638138646674864025_xiaomi-redmi-12c-xam-2.jpg\" alt=\"Xiaomi Redmi 12C 4GB - 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/8/638138646675115995_xiaomi-redmi-12c-xam-3.jpg\" alt=\"Xiaomi Redmi 12C 4GB - 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/8/638138646674627859_xiaomi-redmi-12c-xam-4.jpg\" alt=\"Xiaomi Redmi 12C 4GB - 64GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/3/8/638138646673521195_xiaomi-redmi-12c-xam-5.jpg\" alt=\"Xiaomi Redmi 12C 4GB - 64GB\">', 1, '1', '2023-05-14 11:36:52', '2023-05-14 11:36:52'),
(20, 4, 1, 'Xiaomi Redmi A1 2GB-32GB', 1890000, 29, '<tr><td>Màn hình</td><td>6.52 inch, HD+, 720 x 1600 Pixels</td></tr><tr><td>Camera sau</td><td>8.0 MP </td></tr><tr><td>Camera Selfie</td><td>5.0 MP </td></tr><tr><td>RAM</td><td>2 GB</td></tr><tr><td>Bộ nhớ trong</td><td>32 GB</td></tr><tr><td>CPU</td><td>Helio A22</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android GO</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>2022</td></tr>', '<p>Redmi A1 tiếp tục là một chiếc điện thoại giá rẻ mang đến trải nghiệm tuyệt vời từ Xiaomi với mặt lưng da sang trọng, màn hình lớn, giao diện Android gốc dễ sử dụng, camera kép và viên pin dung lượng lên tới 5000 mAh.</p><p>Độc đáo với mặt lưng da sang trọng</p><p>Màn hình lớn độ sáng cao</p><p>Thoải mái sử dụng không lo hết pin</p><p>Hoạt động mượt mà</p><p>Giao diện thân thiện, dễ dàng sử dụng</p><p>Lưu giữ những khoảnh khắc đáng nhớ</p><p>Hai SIM và hỗ trợ thẻ nhớ</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/30/638001575577748669_xiaomi-redmi-a1-xanh-5.jpg\" alt=\"Xiaomi Redmi A1 2GB-32GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/30/638001575577123843_xiaomi-redmi-a1-xanh-2.jpg\" alt=\"Xiaomi Redmi A1 2GB-32GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/30/638001575577279959_xiaomi-redmi-a1-xanh-3.jpg\" alt=\"Xiaomi Redmi A1 2GB-32GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/30/638001575577279959_xiaomi-redmi-a1-xanh-4.jpg\" alt=\"Xiaomi Redmi A1 2GB-32GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/30/638001575576187403_xiaomi-redmi-a1-xanh-1.jpg\" alt=\"Xiaomi Redmi A1 2GB-32GB\">', 2, '1', '2023-05-14 11:36:52', '2023-05-14 11:36:52');
INSERT INTO `product` (`id`, `brand_id`, `category_id`, `name`, `price`, `quantity`, `specs`, `description`, `image`, `sale_id`, `status`, `created_at`, `updated_at`) VALUES
(21, 2, 1, 'Samsung Galaxy A04s', 3390000, 19, '<tr><td>Màn hình</td><td>6.5 inch, PLS LCD, HD+, 720 x 1600 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 2.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>5.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>64 GB</td></tr><tr><td>CPU</td><td>Exynos 850</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam / Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>2022</td></tr>', '<p>Samsung Galaxy A04s nâng tầm trải nghiệm với hệ thống camera 50MP, màn hình siêu mượt mà 90Hz và pin lớn. Tất cả hội tụ để người dùng có thể tận hưởng được công nghệ tiện lợi ở mức giá phải chăng cho cuộc sống năng động.</p><p>Mãn nhãn với màn hình 90Hz mượt mà</p><p>Tôn vinh nét đẹp tối giản</p><p>Bộ 3 camera 50MP, chụp ảnh tuyệt đẹp</p><p>Mọi khung hình selfie rạng rỡ</p><p>Trải nghiệm nhiều hơn với viên pin lớn</p><p>Sức mạnh tối ưu cho tốc độ tối đa</p><p>Giải trí cực đã với âm thanh Dolby Atmos</p><p>Mở khóa cạnh bên tiện lợi</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/14/637987530648955323_samsung-galaxy-a04s-den-4.jpg\" alt=\"Samsung Galaxy A04s\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/14/637987530648799053_samsung-galaxy-a04s-den-1.jpg\" alt=\"Samsung Galaxy A04s\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/14/637987530647861536_samsung-galaxy-a04s-den-3.jpg\" alt=\"Samsung Galaxy A04s\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/14/637987530646611531_samsung-galaxy-a04s-den-5.jpg\" alt=\"Samsung Galaxy A04s\"><im