(22, 6, 1, 'realme C35 4GB-128GB', 3490000, 18, '<tr><td>Màn hình</td><td>Chính: 6.58 inch, Chính: IPS LCD, FHD+, 1080 x 2408 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 2.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>8.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Unisoc T616</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 11</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>04/2022</td></tr>', '<p>Khoác lên mình thiết kế đột phá và sử dụng màn hình 6.6 inch Full HD xuất sắc, Realme C35 gây ấn tượng mạnh nhờ cụm ba camera 50MP AI cùng viên pin khủng 5.000 mAh cho hiệu suất cả ngày dài. Chip xử lý xuất sắc đi kèm thân máy siêu mỏng cũng là những yếu tố khiến bạn phải trầm trồ trước siêu phẩm trong tầm giá phải chăng này.</p><p>Thân máy siêu mỏng, thiết kế đột phá</p><p>Không gian hiển thị rộng, độ phân giải ấn tượng</p><p>Bộ ba camera tái hiện từng khoảnh khắc</p><p>Selfie xuất sắc với camera 8MP cảm biến Sony</p><p>Pin xuất sắc, chế độ siêu tiết kiệm năng lượng</p><p>Chip xử lý với hiệu năng mạnh mẽ</p><p>Đạt chứng nhận uy tín về độ bền</p><p>Cảm biến vân tay tiện lợi và khay SIM 2+1</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/4/12/637853607399530098_realme-c35-den-1.jpg\" alt=\"realme C35 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/4/12/637853607399373836_realme-c35-den-2.jpg\" alt=\"realme C35 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/4/12/637853607399217526_realme-c35-den-3.jpg\" alt=\"realme C35 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters