(27, 5, 1, 'Vivo Y16 4GB-128GB', 3690000, 14, '<tr><td>Màn hình</td><td>Chính: 6.51 inch, LCD, HD+, 720 x 1600 Pixels</td></tr><tr><td>Camera sau</td><td>13.0 MP + 2.0 MP </td></tr><tr><td>Camera Selfie</td><td>5.0 MP </td></tr><tr><td>RAM</td><td>4 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Helio P35</td></tr><tr><td>GPU</td><td>PowerVR GE8320</td></tr><tr><td>Dung lượng pin</td><td>5000 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 2 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Trung Quốc </td></tr><tr><td>Thời gian ra mắt</td><td>09/2022</td></tr>', '<p>vivo Y16</p><p> là sản phẩm tiếp theo sử dụng thiết kế hợp xu hướng mà vivo tạo ra, chiếc điện thoại này được định vị trong phân khúc giá rẻ nhưng sở hữu nhiều thông số ấn tượng từ camera đến hiệu năng và hiệu suất năng lượng. Cùng với vivo Y02s và vivo Y22s, chúng cho thấy đây là những lựa chọn hợp lý cho phân khúc từ 3-6 triệu đồng. </p><p>Phối màu cực chất</p><p>Vẻ ngoài thon gọn, tươi mới</p><p>Đa nhiệm và khả năng lưu trữ không phải là vấn đề</p><p>Thêm dung lượng, thêm mượt mà</p><p>Tràn đầy năng lượng cho cả ngày dài</p><p>Không bao giờ là giới hạn </p><p>Không gian trải nghiệm rộng lớn</p><p>Thỏa sức sáng tạo trong tầm tay</p><p>Tỏa sáng dù chụp dưới môi trường ánh sáng nào</p><p>Tái tạo khuôn mặt cực ấn tượng </p><p>Chiến game không lo giật lag</p><p>Nhiều tiện ích tiện lợi</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/9/637983383787837357_vivo-y16-vang-6.jpg\" alt=\"Vivo Y16 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/9/637983383787528657_vivo-y16-vang-7.jpg\" alt=\"Vivo Y16 4GB-128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/8/29/637973623420693075_vivo-y16-va