(28, 2, 1, 'Samsung Galaxy Z Fold4 5G 256GB', 32990000, 30, '<tr><td>Màn hình</td><td>Phụ: 6.2 inch, Chính: 7.6 inch, Dynamic AMOLED 2X, WXGA+, Màn hình chính: 2176 x 1812 Pixels</td></tr><tr><td>Camera sau</td><td>50.0 MP + 12.0 MP + 10.0 MP </td></tr><tr><td>Camera Selfie</td><td>10.0 MP </td></tr><tr><td>RAM</td><td>12 GB</td></tr><tr><td>Bộ nhớ trong</td><td>256 GB</td></tr><tr><td>CPU</td><td>Snapdragon 8+ Gen 1</td></tr><tr><td>Dung lượng pin</td><td>4400 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 1 eSIM, 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam </td></tr><tr><td>Thời gian ra mắt</td><td>04/2023</td></tr>', '<p>Với Samsung Galaxy Z Fold4, smartphone màn hình gập đã trở nên thân thiện, tiện dụng và bền bỉ hơn rất nhiều. Những cải tiến thiết thực trong từng khía cạnh giúp sản phẩm biến hóa linh hoạt hơn và đem lại những trải nghiệm không thể tìm thấy ở đâu khác.</p><p>Đẳng cấp của chiếc smartphone hai màn hình</p><p>Mỏng hơn, sang trọng hơn và trau chuốt hơn</p><p>Đa nhiệm dễ dàng, làm việc chuyên nghiệp</p><p>S-Pen linh hoạt trên từng nét vẽ</p><p>Màn hình Infinity Flex trọn vẹn và ấn tượng</p><p>Smartphone gập bền bỉ nhất trong lịch sử</p><p>Nightography đánh bại mọi thách thức ánh sáng</p><p>Camera chính 50MP sáng tạo những kiệt tác</p><p>Zoom quang 3X thu hẹp mọi khoảng cách không gian</p><p>Đạt tới hiệu suất đỉnh cao với chip xử lý 4nm</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/4/10/638167221773541058_samsung-galaxy-z-fold4-do-1.jpg\" alt=\"Samsung Galaxy Z Fold4 5G 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2023/4/10/638167221773487338_samsung-galaxy-z-fold4-do-2.jpg\" alt=\"Samsung Galaxy Z Fold4 5G 256GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Orig