(29, 2, 1, 'Samsung Galaxy Z Flip4 5G 256GB Flex Mode Collection', 17990000, 22, '<tr><td>Màn hình</td><td>Chính: 6.7 inch, Phụ: 1.9 inch, Dynamic AMOLED, FHD+, 1080 x 2636 Pixels</td></tr><tr><td>Camera sau</td><td>12.0 MP + 12.0 MP </td></tr><tr><td>Camera Selfie</td><td>10.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>256 GB</td></tr><tr><td>CPU</td><td>Snapdragon 8+ Gen 1</td></tr><tr><td>Dung lượng pin</td><td>3700 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 1 eSIM, 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam </td></tr><tr><td>Thời gian ra mắt</td><td>09/2022</td></tr>', '<p>Linh hoạt biến hóa, không ngừng sáng tạo, Samsung Galaxy Z Flip4 mang đến những xu hướng công nghệ hiện đại, đậm chất thời trang cho người dùng sành điệu. Nay điện thoại còn thêm phần cuốn hút với phiên bản giới hạn Samsung Galaxy Z Flip4 Flex Mode Collection – một sự kết hợp của Samsung và GIA STUDIOS cho phiên bản màu Pink Gold hoặc Blue.</p><p>Tinh tế trong từng chi tiết</p><p> </p><p>Sắc màu thanh lịch, tôn vinh nét đẹp cao cấp</p><p>Biến hóa phong cách mỗi ngày</p><p>Gập nhỏ gọn độc đáo</p><p>Bền bỉ vượt trội, từ ngoài vào trong</p><p>Nâng tầm chụp ảnh với camera linh hoạt</p><p>Khoảnh khắc đêm tỏa sáng</p><p>Dễ dàng có tấm selfie ưng ý</p><p>Hiệu năng đầu bảng, dẫn đầu sức mạnh</p><p>Viên pin dùng cả ngày</p><p>Màn hình ngoài thú vị</p><p>Giới thiệu về GIA STUDIOS</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/13/637986875399707328_samsung-galaxy-z-flip4-flex-mode-collection-1.jpg\" alt=\"Samsung Galaxy Z Flip4 5G 256GB Flex Mode Collection\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/13/637986875397050562_samsung-galaxy-z-flip4-flex-mode-collection-2.jpg\" alt=\"Samsung Galaxy Z Flip4 5G 256GB Flex Mode Collection\"><img src=