(30, 2, 1, 'Samsung Galaxy Z Flip4 5G 128GB', 17270000, 11, '<tr><td>Màn hình</td><td>Chính: 6.7 inch, Phụ: 1.9 inch, Dynamic AMOLED, FHD+, 1080 x 2636 Pixels</td></tr><tr><td>Camera sau</td><td>12.0 MP + 12.0 MP </td></tr><tr><td>Camera Selfie</td><td>10.0 MP </td></tr><tr><td>RAM</td><td>8 GB</td></tr><tr><td>Bộ nhớ trong</td><td>128 GB</td></tr><tr><td>CPU</td><td>Snapdragon 8+ Gen 1</td></tr><tr><td>Dung lượng pin</td><td>3700 mAh</td></tr><tr><td>Thẻ sim</td><td>2 - 1 eSIM, 1 Nano SIM </td></tr><tr><td>Hệ điều hành</td><td>Android 12</td></tr><tr><td>Xuất xứ</td><td>Việt Nam </td></tr><tr><td>Thời gian ra mắt</td><td>08/2022</td></tr>', '<p>Nhỏ gọn và tinh tế, Samsung Galaxy Z Flip4 là chiếc smartphone sinh ra dành cho các tín đồ thời trang. Cơ chế gập duyên dáng, bộ màu sắc nhẹ nhàng và loạt chức năng quay chụp sẽ làm say lòng những người yêu cái đẹp.</p><p>Chiếc smartphone thời trang nhất bạn từng thấy</p><p>Linh hoạt khi gập mở, cơ động để mang theo</p><p>Thoải mái gập mở tới 200.000 lần</p><p>Mạnh mẽ, bền bỉ, chuẩn chống nước IPX8</p><p>Khi mọi khung hình đều trở nên tươi sáng</p><p>FlexCam: Góc chụp linh hoạt, hoàn toàn rảnh tay</p><p>Trải nghiệm selfie đã bước lên một tầm cao mới</p><p>Sáng tạo và mở rộng góc nhìn</p><p>Những cải tiến mạnh mẽ về pin và công nghệ sạc</p><p>Biến hóa linh hoạt với màn hình phụ</p><p>Phản hồi SMS nhanh và nhiều thao tác khác</p><p>Sức mạnh của chip xử lý hàng đầu thế giới</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/8/10/637957658354316100_samsung-galaxy-z-flip4-tim-1.jpg\" alt=\"Samsung Galaxy Z Flip4 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/8/10/637957703261967280_samsung-galaxy-z-flip4-tim-2.jpg\" alt=\"Samsung Galaxy Z Flip4 5G 128GB\"><img src=\"https://images.fpt.shop/unsafe/fit-in/585x390/filters:quality(90):fill(white)/fptshop.com.vn/U