(32, 9, 2, 'Pin sạc dự phòng UmeTravel 20000mAh TRIP20000 Quick Charge', 899000, 24, '<tr>\n<td>Dung lượng pin</td>\n<td>20000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium polymer</td>\n</tr><tr>\n<td>Cổng kết nối</td>\n<td>Đầu ra: Type C, Đầu ra: USB 2.0, Đầu vào: Type C, Đầu vào: Micro-USB</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Quản lý nguồn; Lõi pin cao cấp; Tự động cân bằng thời gian sạc và hiệu chỉnh dòng</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>UmeTravel</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Trung Quốc</td>\n</tr>', '<p>Với thiết kế thông minh, sở hữu nhiều tính năng hiện đại và hết sức bền bỉ, bộ pin sạc dự phòng Quick Charge UMETRAVEL TRIP20000 sẽ là giải pháp tối ưu để bạn đem theo năng lượng dự trữ bên mình. Kích cỡ gọn nhẹ của sản phẩm cho phép bộ sạc phát huy tối đa tính cơ động nhằm hỗ trợ người dùng tốt hơn.</p><p>Hệ thống cổng kết nối đa dạng</p><p>Sạc cùng lúc cho 3 thiết bị khác nhau</p><p>Dung lượng pin xuất sắc 20.000 mAh</p><p>Đảm bảo an toàn với chip điện tử thông minh</p><p>Sạc nhanh chóng để bạn không phải chờ lâu</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/9/5/637979831444940203_pin-sac-du-phong-quick-charge-li-polymer-20000mah-umetravel-trip20000-den.jpg\" alt=\"Pin sạc dự phòng UmeTravel 20000mAh TRIP20000 Quick Charge\">', 3, '1', '2023-05-14 12:00:01', '2023-05-14 12:00:01'),
