(34, 9, 2, 'Pin sạc dự phòng UmeTravel 10000 mAh SKY10000 Quick Charge', 539000, 17, '<tr>\n<td>Dung lượng pin</td>\n<td>10000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium-ion</td>\n</tr><tr>\n<td>Cổng kết nối</td>\n<td>Đầu ra: Type C, Đầu vào: Type C, Đầu ra: USB 2.0</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Lõi pin cao cấp; Hỗ trợ sạc nhanh cho các thiết bị hỗ trợ chuẩn QC và SCP; Tự động cân bằng thời gian sạc và hiệu chỉnh dòng</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>UmeTravel</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Trung Quốc</td>\n</tr>', '<p>Đến từ thương hiệu nổi danh uy tín trong lĩnh vực sản xuất phụ kiện, UMETRAVEL SKY10000 đem tới những công nghệ hiện đại nhất để đảm bảo sự tiện lợi và an toàn trong quá trình sạc pin. Dung lượng 10.000 mAh kết hợp với màn hình theo dõi phần trăm pin giúp bạn an tâm sạc và sử dụng với điện thoại/máy tính bảng mọi lúc mọi nơi.</p><p>Kích thước nhỏ nhẹ nằm gọn trong tay</p><p>Sạc pin nhiều lần cho smartphone của bạn</p><p>Đạt tiêu chuẩn chứng nhận về độ an toàn</p><p>Lõi pin cao cấp, IC chống cháy nổ</p><p>Biện pháp sạc nhanh hiệu quả </p><p>Hệ thống cổng kết nối đa dạng, hiện đại</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2021/1/18/637465828670563518_FRT07925-1.jpg\" alt=\"Pin sạc dự phòng UmeTravel 10000 mAh SKY10000 Quick Charge\">', 1, '1', '2023-05-14 12:01:44', '2023-05-14 12:01:44'),
