(41, 7, 2, 'Pin sạc dự phòng Anker PowerCore 20000mAh Speed QC 3.0', 1085000, 24, '<tr>\n<td>Dung lượng pin</td>\n<td>20000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium-ion</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Tự động cân bằng thời gian sạc và hiệu chỉnh dòng; Quản lý nguồn; Lõi pin cao cấp</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>Anker</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Trung Quốc</td>\n</tr>', '<p>Được thiết kế với phong cách tối giản gọn nhẹ, sở hữu ba công nghệ sạc nhanh hàng đầu và tương thích mọi dòng smartphone trên thị trường, PowerCore Speed QC 3.0 20.000mAh thực sự là giải pháp tuyệt vời dành cho những người bận rộn để sạc điện thoại và các thiết bị điện tử khác trong chuyến công tác dài ngày.</p><p>Thiết kế gọn gàng và ôm tay</p><p>Hội tụ 3 công nghệ sạc nhanh hiện đại</p><p>Tương thích với hầu hết các smartphone</p><p>Độ bền tối ưu đã qua thử nghiệm</p><p>Điều tiết dòng điện và nhiệt độ</p><p>Không phải băn khoăn với dung lượng 20.000mAh</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2019/2/21/636863546908210946_00547544.jpg\" alt=\"Pin sạc dự phòng Anker PowerCore 20000mAh Speed QC 3.0\">', 2, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(42, 7, 2, 'Pin sạc dự phòng Anker PowerCore II 10000mAh', 730000, 19, '<tr>\n<td>Dung lượng pin</td>\n<td>10000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium-ion</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Tự động cân bằng thời gian sạc và hiệu chỉnh dòng; Quản lý nguồn; Lõi pin cao cấp</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>Anker</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Trung Quốc</td>\n</tr>', '<p>Được thiết kế với phong cách hiện đại, trẻ trung, trang bị nhiều công nghệ hiện đại hỗ trợ sạc nhanh và đảm bảo an toàn cho người dùng, bộ sạc dự phòng Anker PowerCore II 10.000 mAh là phương thức tối ưu nhất để đảm bảo smartphone của bạn được cung ứng năng lượng mọi lúc mọi nơi một cách hiệu quả.</p><p>Nhỏ nhẹ và thực sự linh hoạt</p><p>Nhận diện smartphone nhờ PowerIQ 2.0</p><p>Tương thích với cả iPhone và smartphone Android</p><p>Một lần sạc đầy, dùng trong nhiều lần</p><p>Tái tạo nguồn năng lượng nhanh chóng</p><p>Bảo vệ đa lớp cực kỳ hiệu quả</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2019/2/21/636863542271039285_00547540.jpg\" alt=\"Pin sạc dự phòng Anker PowerCore II 10000mAh\">', 1, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(43, 7, 2, 'Pin sạc dự phòng Anker PowerCore 10000mAh', 530000, 23, '<tr>\n<td>Dung lượng pin</td>\n<td>10000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium-ion</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Tự động cân bằng thời gian sạc và hiệu chỉnh dòng; Lõi pin cao cấp; Quản lý nguồn</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>Anker</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Trung Quốc</td>\n</tr>', '<p>Đến từ thương hiệu nổi danh bậc nhất trong ngành sản xuất phụ kiện điện thoại, bộ sạc dự phòng Anker PowerCore 10.000 mAh không chỉ đem đến trải nghiệm sạc cơ động, an toàn mà còn đảm bảo cả yếu tố tiện dụng nhờ công nghệ sạc nhanh hiệu quả. Sản phẩm có kích cỡ nằm gọn trong lòng bàn tay để bạn đem theo bên mình dễ dàng.</p><p>Phát huy sự linh hoạt cần có của sạc dự phòng</p><p>Hai công nghệ sạc độc quyền của Anker</p><p>Tích trữ năng lượng cho nhiều lần sạc</p><p>Bảo vệ an toàn với MultiProtect</p><p>Dễ dàng quan sát dung lượng pin còn lại</p><p>Kiểm định nghiêm ngặt về độ bền</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2019/2/21/636863542270727295_00547538.jpg\" alt=\"Pin sạc dự phòng Anker PowerCore 10000mAh\">', 3, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(44, 8, 2, 'Pin sạc dự phòng ivalue 10000mAh MT-P100-012 (HK-104) Đen', 225000, 18, '<tr>\n<td>Thương hiệu</td>\n<td>i.value</td>\n</tr>', '', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2019/4/22/636915260545872871_SAC-5.jpg\" alt=\"Pin sạc dự phòng ivalue 10000mAh MT-P100-012 (HK-104) Đen\">', 1, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(45, 8, 2, 'Pin sạc dự phòng ivalue 10000mAh Y1-5 Trắng cổng Micro & Type-C', 299500, 24, '<tr>\n<td>Thương hiệu</td>\n<td>i.value</td>\n</tr>', '', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2019/1/12/636828848121942095_00525999-chitiet-1.png\" alt=\"Pin sạc dự phòng ivalue 10000mAh Y1-5 Trắng cổng Micro & Type-C\">', 1, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(46, 8, 2, 'Pin sạc dự phòng ivalue 10000mAh J18 Trắng', 299500, 14, '<tr>\n<td>Thương hiệu</td>\n<td>i.value</td>\n</tr>', '', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2018/12/6/636797150669253773_HASP-PK-SDP-ivalue-J18-997-5.jpg\" alt=\"Pin sạc dự phòng ivalue 10000mAh J18 Trắng\">', 3, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(47, 10, 2, 'Pin sạc dự phòng Veger 10000mAh L10 PD&QC3.0 Đen', 559300, 23, '<tr>\n<td>Dung lượng pin</td>\n<td>10000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium polymer</td>\n</tr><tr>\n<td>Cổng kết nối</td>\n<td>Đầu ra: USB 3.0, Đầu ra: Type C</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Tự động cân bằng thời gian sạc và hiệu chỉnh dòng; Lõi pin cao cấp; Quản lý nguồn</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>Veger</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Trung Quốc</td>\n</tr>', '<p>Bộ pin sạc dự phòng Li-Polymer VEGER L10 PD&QC3.0 hội tụ những công nghệ hiện đại nhất trong lĩnh vực bao gồm kiểm soát nguồn điện Power Delivery và sạc nhanh Quick Charge 3.0. Nhờ vậy, sản phẩm đảm bảo hai yếu tố then chốt là độ an toàn và tính tiện dụng. Ngoài ra, thiết kế hiện đại sang trọng cũng là điểm cộng lớn mà VEGER đem tới cho thiết bị.</p><p>Thiết kế sang trọng và lịch lãm</p><p>Màn hình hiển thị phần trăm pin</p><p>Những công nghệ sạc tối tân hàng đầu</p><p>Rút ngắn thời gian chờ đợi cho bạn</p><p>Dung lượng 10.000 mAh với lõi pin cao cấp</p><p>Nhiều cổng sạc, tương thích với mọi smartphone</p><p>Vận hành an toàn, chống cháy nổ</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2018/12/6/636796845110708154_L10 PDQC3.0 06.jpg\" alt=\"Pin sạc dự phòng Veger 10000mAh L10 PD&QC3.0 Đen\">', 3, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(48, 2, 2, 'Sạc dự phòng Samsung 20.000mAh - 25W', 890000, 20, '<tr>\n<td>Dung lượng pin</td>\n<td>20000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium polymer</td>\n</tr><tr>\n<td>Cổng kết nối</td>\n<td>Đầu ra: USB, Đầu vào: Type C</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Tự động cân bằng thời gian sạc và hiệu chỉnh dòng; Lõi pin cao cấp; Quản lý nguồn; Sạc nhanh 25W</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>Samsung</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Việt Nam / Trung Quốc</td>\n</tr>', '<p>Không chỉ có dung lượng cao, pin sạc dự phòng Samsung 20000mAh EB-P5300 còn hỗ trợ công nghệ sạc nhanh và khả năng tương thích tuyệt vời. Sản phẩm không quá to và nặng, tích hợp nhiều chế độ an toàn khác nhau.</p><p>Hỗ trợ công nghệ sạc nhanh 25W</p><p>Sạc nhiều lần cho thiết bị của bạn</p><p>Nhỏ gọn, tiện lợi để mang theo</p><p>Tương thích với nhiều loại thiết bị</p><p>Sạc cho 3 thiết bị cùng lúc</p><p>Đảm bảo an toàn</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/8/9/637956565902756897_sac-du-phong-samsung-20000mah-25w-den-5.jpg\" alt=\"Sạc dự phòng Samsung 20.000mAh - 25W\">', 3, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42'),
(49, 2, 2, 'Sạc dự phòng Samsung 10.000mAh - 25W', 590000, 15, '<tr>\n<td>Dung lượng pin</td>\n<td>10000 mAh</td>\n</tr><tr>\n<td>Lõi pin</td>\n<td>Lithium polymer</td>\n</tr><tr>\n<td>Cổng kết nối</td>\n<td>Đầu vào: Type C, Đầu ra: USB</td>\n</tr><tr>\n<td>Tính năng</td>\n<td>Sạc nhanh 25W; Lõi pin cao cấp; Quản lý nguồn; Tự động cân bằng thời gian sạc và hiệu chỉnh dòng</td>\n</tr><tr>\n<td>Thương hiệu</td>\n<td>Samsung</td>\n</tr><tr>\n<td>Xuất xứ</td>\n<td>Việt Nam / Trung Quốc</td>\n</tr>', '<p>Sạc dự phòng Samsung EB-P3300 không chỉ sở hữu thiết kế sang trọng mà nó còn hỗ trợ công nghệ sạc nhanh và khả năng tương thích với nhiều loại thiết bị. Sản phẩm sẽ giúp cho cuộc sống của bạn trở nên liền mạch với thiết bị luôn đầy pin suốt ngày dài.</p><p>Sạc với công suất 25W</p><p>Sang trọng và nhỏ gọn</p><p>Sạc cho nhiều thiết bị cùng lúc</p><p>Dung lượng 10.000mAh</p>', '<img src=\"https://images.fpt.shop/unsafe/fit-in/750x500/filters:quality(90):fill(white)/fptshop.com.vn/Uploads/Originals/2022/8/9/637956561803414806_sac-du-phong-samsung-10000mah-25w-xam-5.jpg\" alt=\"Sạc dự phòng Samsung 10.000mAh - 25W\">', 1, '1', '2023-05-14 12:02:42', '2023-05-14 12:02:42');
